import { Box, Container } from '@chakra-ui/react'
import React from 'react'

const Homepage = () => {
  return (
    <Container maxW='xl' centerContent>
      <Box
      d='flex'
      justifyContent='center'
      p={3}
      bg={"white"}
      w="100%"
      m="40px 0 15px 0"
      borderRadius ="lg"
      borderWidth="1px"



      >
        <Text fontSize='4xl'>WaveTalk</Text>
      </Box>
      <Box></Box>
    </Container>
  );
}

export default Homepage
